        <>
        <br/>
        <br/>
        <br/>
        <br/>
         <div className='container cnt-p'>
         <h6 className='text-center'>Get in Touch</h6>
         <h2 className='text-center'>Contact</h2>
             <div className='row mt-5'>
                 <div className='col-lg-6 col-md-6 col-12'></div>
                 <div className='col-lg-6 col-md-6 col-12'></div>
             </div>
         </div>
        </>
    );
};
export default Contact;
